script: |
  super -f text -I q9510.spq | sort > q9510.out

inputs:
  - name: q9510.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT col0 / col1 - + col2 - - - 59 + - col0 BETWEEN 50 AND + 63 / - col1 + + col2;
  - name: tab2

outputs:
  - name: q9510.out
    data: |
      46	51	23
      64	77	40
      75	67	58
